    const signInWithGoogle = () => {

        signInWithPopup(auth,provider).then
    }


  return (
    <div className='loginPage'>
      <p> Sign with Google to continue</p>
      <button className='login-with-google-btn'> Sign In</button>
    </div>
  );
}

export default Login
